import React from "react";

function Succes(){
    const state = {
        lifeAchievements: [
            {
                id:1,
                title: 'horloge',
                waarde: 300
            },
            {
                id:2,
                title: 'auto',
                waarde: 18000
            },
            {
                id:3,
                title: 'huis',
                waarde: 400000
            }
        ]
    }

   
    return this.state.lifeAchievements((achievement) => 
    <h3>achievement.title</h3>);
}

export default Succes;
